import React, {useState} from 'react';
import logo from './logo.svg';
import './App.css';

class Test {

}

function App() {
  const [debug, setDebug] = useState(false)
  const [five, setFive] = useState({five: 5})

  return (
    <div className="App">
      <button onClick={
        () => {setDebug(!debug)}
      }>Set Debug Outputs</button>
      <p>Debug state: {debug}</p>
    </div>
  );
}

export default App;
